export const siteData = {
  "title": "KORA",
  "description": " welcome KORA-BOOK",
  "base": "/",
  "pages": [
    {
      "key": "v-60a0b0fe6831f",
      "path": "/",
      "title": "Home",
      "frontmatter": {
        "home": true,
        "heroImage": "/images/KR.png",
        "actionText": "快速上手 →",
        "actionLink": "guide.html",
        "features": [
          {
            "title": "简洁至上",
            "details": "以 Markdown 为中心的项目结构，以最少的配置帮助你专注于写作。"
          },
          {
            "title": "Vue驱动",
            "details": "享受 Vue + webpack 的开发体验，在 Markdown 中使用 Vue 组件，同时可以使用 Vue 来开发自定义主题。"
          },
          {
            "title": "高性能",
            "details": "VuePress 为每个页面预渲染生成静态的 HTML，同时在页面被加载的时候，将作为 SPA 运行。"
          }
        ],
        "footer": "MIT Licensed | Copyright © 2018-present Evan You"
      }
    }
  ],
  "themeConfig": {
    "nav": [
      {
        "text": "主页",
        "link": "/"
      },
      {
        "text": "笔记",
        "items": [
          {
            "text": "Android",
            "link": "/android/"
          },
          {
            "text": "ios",
            "link": "/ios/"
          },
          {
            "text": "Web",
            "link": "/web/"
          }
        ]
      },
      {
        "text": "关于",
        "link": "/about/"
      },
      {
        "text": "Github",
        "link": "https://www.github.com/codeteenager"
      }
    ],
    "sidebar": [
      {
        "title": "前端迷途知路",
        "children": [
          "",
          ""
        ]
      },
      {
        "title": "后端望而却步",
        "children": [
          "/"
        ]
      }
    ],
    "sidebarDepth": [
      "/",
      "/android/",
      "/ios/"
    ]
  }
}
